
import socket

def microhttp():
    try:
        socket1 = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
        socket1.bind(("",80))
        socket1.listen(10)
        print("Listening for connections")
        while True:
            conn, address = socket1.accept();
            print(" + Client Connected - Sending Page!")
            newdata = conn.recv(1000)

            htmldoc = """
            <html>
                <head>
                    <title>Hello World</title>
                </head>

                <body>
                    <p>
                    <b>Tristan S</b></br>
                    Friday Lab - CI CD with Jenkins and Terraform</br>
                    </br>
                    <img src="data:image/png;base64," />

                </body>
            </html>
            """;
            replymsg = """HTTP/1.1 200 OK\r\nserver: sre-training-ts\r\ncontent-type: text/html; charset="UTF-8"\r\ncontent-length: """ + str(len(htmldoc))  + """\r\n\r\n""";
            conn.send(replymsg + htmldoc)
            conn.close()
    except:
        print("Server threw an error - Make sure to run as root")
        conn.close()
    return

microhttp();
